BlocklyGamesMsg["Pond.helpUseScan"] = "Η λύση αποδίδει, αλλά μπορείτε να την βελτιώσετε. Χρησιμοποιείστε την 'scan' για να οπλίσετε το κανόνι για την απόσταση βολής.";
BlocklyGamesMsg["Pond.helpText1"] = "Επιλέξετε την εντολή 'cannon' για να χτυπήσετε τον στόχο. Η πρώτη παράμετρος είναι η γωνία, η δεύτερη είναι η σειρά. Βρέστε τον σωστό συνδυασμό.";
BlocklyGamesMsg["Pond.helpText2"] = "Πρέπει να χτυπήσετε αυτό ν τον στόχο πολλές φορές. Χρησιμοποιείστε την ρύθμιση ένα 'while (true)' για να κάνετε κάτι τυχαίο.";
BlocklyGamesMsg["Pond.helpText3a"] = "Αυτός ο αντίπαλος κινείτε μπροστά και πίσω και έτσι είναι δύσκολο να πετύχετε τον στόχο. Ο όρος 'scan' επαναφέρει την ακριβή σειρά στον αντίπαλο στην συγκεκριμένη κατεύθυνση.";
BlocklyGamesMsg["Pond.helpText3b"] = "Αυτή η πλευρά είναι ακριβώς σύμφωνα με την εντολή που δίνεται στο 'cannon' να πυροβολήσει με ακρίβεια.";
BlocklyGamesMsg["Pond.helpText4"] = "Αυτός ο αντίπαλος είναι πολύ μακρυά για να χρησιμοποιήσει το κανόνι (που έχει ένα όριο 70 μέτρων). Αντιθέτως, χρησιμοποίησε την εντολή 'swim' για να αρχίσει να κολυμπά προς τον αντίπαλο και να τον χτυπήσει.";
BlocklyGamesMsg["Pond.helpText5"] = "Αυτός ο αντίπαλος είναι επίσης πολύ μακριά για να χρησιμοποιήσει το κανόνι. Αλλά είσαι πολύ αδύνατος για να επιβιώσεις μετά από μια σύγκρουση. Κολύμπησε προς το μέρος του αντιπάλου ενώ η οριζόντια τοποθεσία είναι μικρότερη από 50. Μετά 'stop' και χρησιμοποίησε το κανόνι.";
BlocklyGamesMsg["Pond.helpText6"] = "Αυτός ο αντίπαλος θα φύγει μακριά όταν χτυπηθεί. Κολύμπα προς το μέρος του αν είναι εκτός βεληνεκούς (70 μέτρα).";
